from typing import List


def main(num1: List, num2: List):
    if len(num1) != len(num2):
        return -1
    else:
        l = len(num1)
        res = []
        for i in range(l):
            operation = int(num1[i]) * int(num2[i])
            res.append(str(operation))

        res_ops = ''.join(res)
        return int(res_ops)


