#include<bits/stdc++.h>
using namespace std;
#define ll long long
const int N=1000005;
#define INF 0x3fffffff
const int mod=1e9+7;

void solve()
{
	string a,b;
    cin>>a>>b;
    int sa=a.length();
    int sb=b.length();
    if(sa!=sb)
    {
        cout<<"-1"<<endl;
        return;
    }
    else
    {
        string ans="";
        for(int i=0;i<sa;i++)
        {
            int na=a[i]-'0';
            int nb=b[i]-'0';
            int sum=na*nb;
            if(sum==0)
            {
                ans+='0';
                continue;
            }
            if(sum>=10)
            {
                int n1=sum/10;
                int n2=sum%10;
                ans+=n1+'0';
                ans+=n2+'0';
            }
            else
            {
                ans+=sum+'0';
            }
        }
        cout<<ans<<endl;
    }
}
